                    <Product title = "Seven Husbands" image= {img41} price = {12.32}/>
                    <Product title ="Harry Potter" image={img42} price = {15.14}/>
                 </div>
                 <div className='home_row'>
                    <Product title = "Power" image= {img43} price = {19.22}/>
                    <Product title = "Reminders of him" image= {img44} price = {20.12}/>
                    <Product title = "Seven Husbands" image= {img45} price = {12.32}/>
                    <Product title ="Harry Potter" image={img46} price = {15.14}/>
                 </div>

            </div>
        </div>

    );
}

export default home;
